羅東城隍廟細木雕刻，主要表現在正面木格扇與步口廊之構架。左右通樑均施以彩繪，通樑上方採瓜筒形式，瓜筒上方各雕有兩尊臉孔相對的小型戲齣人物木雕；在束隨部分的構件，則雕以具吉祥寓意的四季花鳥題材。在龍邊的員光則採「國色天香」題材，是由鳳凰與富貴花牡丹所構成；虎邊員光則採「喜上眉梢」的題材，可見多隻喜鵲與數量眾多的梅花之搭配，且梅花樹枝尚有類似剖面可見枝幹中空的特殊表現。此外，兩片員光材之下方均未設邊框，是較為特殊之處。

